import React from "react";
import "./css/Cadastra.css";

const url = " http://localhost:8000/cadastro";
const btnSalvar = document.querySelector("button");

btnSalvar.addEventListener("click", async(e) => {
    e.preventDefault();
    if (await Cadastra()) {
        // location.assign("/");
        alert("Cadastrado com sucesso!");
    } else {
        alert("Não foi possível cadastrar!");
    }
});

const Cadastra = () => {
  return (
    <form id="cadastro" className="cadastro">
      <h1>newsletter</h1>
      <label>
        Nome:
        <input className="inpt" type="text" />
      </label>
      <label>
        E-mail:
        <input className="inpt" type="text" />
      </label>
      <input className="envia" type="submit" value="Enviar" />
    </form>
  );
};

export default Cadastra;
